import ColumnFilter from './ColumnFilter';

let COLUMNS = [
    {
        Header: 'Name',
        accessor: 'full_name',
        Filter: ColumnFilter,
        displayFilter: False
    },
    {
        Header: 'Pos',
        accessor: 'pos',
        Filter: ColumnFilter
    },
    {
        Header: 'Ovr',
        accessor: 'ovr',
        Filter: ColumnFilter
    }
];

export {COLUMNS};
